import{b as e}from"./app.9da19d67.js";import{_ as r}from"./plugin-vue_export-helper.21dcd24c.js";const a={},t=e('<h2 id="netty-nio" tabindex="-1"><a class="header-anchor" href="#netty-nio" aria-hidden="true">#</a> Netty&amp;NIO</h2><p>Netty \u662F\u4E00\u4E2A\u5F02\u6B65\u7684\u3001\u57FA\u4E8E\u4E8B\u4EF6\u9A71\u52A8\u7684\u7F51\u7EDC\u5E94\u7528\u6846\u67B6\uFF0C\u5B83\u53EF\u4EE5\u7528\u6765\u5F00\u53D1\u9AD8\u6027\u80FD\u670D\u52A1\u7AEF\u548C\u5BA2\u6237\u7AEF\u3002</p><h3 id="\u95EE\u9898" tabindex="-1"><a class="header-anchor" href="#\u95EE\u9898" aria-hidden="true">#</a> \u95EE\u9898</h3><p>\u4EE5\u524D\u7F16\u5199\u7F51\u7EDC\u8C03\u7528\u7A0B\u5E8F\u7684\u65F6\u5019\uFF0C\u6211\u4EEC\u90FD\u4F1A\u5728\u5BA2\u6237\u7AEF\u521B\u5EFA\u4E00\u4E2A Socket\uFF0C\u901A\u8FC7\u8FD9\u4E2A Socket \u8FDE\u63A5\u5230\u670D\u52A1\u7AEF\u3002</p><p>\u670D\u52A1\u7AEF\u6839\u636E\u8FD9\u4E2A Socket \u521B\u5EFA\u4E00\u4E2A Thread\uFF0C\u7528\u6765\u53D1\u51FA\u8BF7\u6C42\u3002\u5BA2\u6237\u7AEF\u5728\u53D1\u8D77\u8C03\u7528\u4EE5\u540E\uFF0C\u9700\u8981\u7B49\u5F85\u670D\u52A1\u7AEF\u5904\u7406\u5B8C\u6210\uFF0C\u624D\u80FD\u7EE7\u7EED\u540E\u9762\u7684\u64CD\u4F5C\u3002\u8FD9\u6837\u7EBF\u7A0B\u4F1A\u51FA\u73B0\u7B49\u5F85\u7684\u72B6\u6001\u3002</p><p>\u5982\u679C\u5BA2\u6237\u7AEF\u8BF7\u6C42\u6570\u8D8A\u591A\uFF0C\u670D\u52A1\u7AEF\u521B\u5EFA\u7684\u5904\u7406\u7EBF\u7A0B\u4E5F\u4F1A\u8D8A\u591A\uFF0CJVM \u5982\u6B64\u591A\u7684\u7EBF\u7A0B\u5E76\u4E0D\u662F\u4E00\u4EF6\u5BB9\u6613\u7684\u4E8B\u3002</p><h2 id="nio" tabindex="-1"><a class="header-anchor" href="#nio" aria-hidden="true">#</a> NIO</h2><h2 id="_1\u3001buffer-\u7F13\u51B2\u533A" tabindex="-1"><a class="header-anchor" href="#_1\u3001buffer-\u7F13\u51B2\u533A" aria-hidden="true">#</a> 1\u3001Buffer-\u7F13\u51B2\u533A</h2><p>Buffer\u662F\u4E00\u4E2A\u5BF9\u8C61\uFF0C\u5B83\u5305\u542B\u4E00\u4E9B\u8981\u5199\u5165\u6216\u8005\u8981\u8BFB\u53D6\u7684\u6570\u636E\u3002\u5728NIO\u7C7B\u5E93\u4E2D\u52A0\u5165Buffer\u5BF9\u8C61\uFF0C\u4F53\u73B0\u4E86\u65B0\u5E93\u4E0E\u539FIO\u7684\u4E00\u4E2A\u91CD\u8981\u7684\u533A\u522B\u3002</p><p>\u5728\u9762\u5411\u6D41\u7684IO\u4E2D\uFF0C\u53EF\u4EE5\u5C06\u6570\u636E\u76F4\u63A5\u5199\u5165\u6216\u8BFB\u53D6\u5230Stream\u5BF9\u8C61\u4E2D\u3002\u5728NIO\u5E93\u4E2D\uFF0C\u6240\u6709\u7684\u6570\u636E\u90FD\u662F\u7528\u7F13\u51B2\u533A\u5904\u7406\u7684\uFF08\u8BFB\u5199\uFF09\u3002\u7F13\u51B2\u533A\u5B9E\u8D28\u4E0A\u662F\u4E00\u4E2A\u6570\u7EC4\uFF0C\u901A\u5E38\u5B83\u662F\u4E00\u4E2A\u5B57\u8282\u6570\u7EC4\uFF08ByteBuffer\uFF09\uFF0C\u8FD9\u4E2A\u5B57\u8282\u8F93\u51FA\u540C\u65F6\u5B58\u50A8\u8F93\u5165\u53CA\u8F93\u51FA\u6570\u636E\uFF0C\u5F53\u7136\u4E5F\u53EF\u4EE5\u4F7F\u7528\u5176\u4ED6\u7C7B\u578B\u7684\u6570\u7EC4\uFF0C\u8FD9\u4E2A\u6570\u7EC4\u4E3A\u7F13\u51B2\u533A\u63D0\u4F9B\u4E86\u6570\u636E\u7684\u8BBF\u95EE\u8BFB\u5199\u7B49\u64CD\u4F5C\u5C5E\u6027\uFF0C\u5982\u4F4D\u7F6E\uFF0C\u5BB9\u91CF\uFF0C\u4E0A\u9650\u7B49\u6982\u5FF5\u3002</p><p>Buffer\u7C7B\u578B\uFF1A\u6211\u4EEC\u5E38\u7528\u7684\u662FByteBuffer\uFF0C\u5B9E\u9645\u4E0A\u6BCF\u4E00\u79CDJava\u57FA\u672C\u7C7B\u578B\u90FD\u5BF9\u5E94\u4E86\u4E00\u79CD\u7F13\u51B2\u533A\uFF08\u9664\u4E86Boolean\u7C7B\u578B\uFF09\u3002</p><p><code>ByteBuffer CharBuffer ShortBuffer IntBuffer LongBuffer FloatBuffer DoubleBuffer BooleanBuffer ByteOrder</code></p><h2 id="_2\u3001channel-\u901A\u9053" tabindex="-1"><a class="header-anchor" href="#_2\u3001channel-\u901A\u9053" aria-hidden="true">#</a> 2\u3001Channel-\u901A\u9053</h2><p>\u901A\u9053\uFF08Channel\uFF09\uFF0C\u4E5F\u88AB\u6210\u4E3A\u7BA1\u9053\uFF0C\u5B83\u5C31\u50CF\u81EA\u6765\u6C34\u7BA1\u9053\u4E00\u6837\uFF0C\u7F51\u7EDC\u6570\u636E\u901A\u8FC7Channel\u8BFB\u53D6\u548C\u5199\u5165\uFF0C\u901A\u9053\u4E0E\u6D41\u4E0D\u540C\u4E4B\u5904\u5728\u4E8E\u901A\u9053\u662F\u53CC\u5411\u7684\uFF0C\u800C\u6D41\u53EA\u662F\u4E00\u4E2A\u65B9\u5411\u4E0A\u79FB\u52A8\uFF08\u4E00\u4E2A\u6D41\u5FC5\u987B\u662FinputStream\u6216\u8005outputStream\u7684\u5B50\u7C7B\uFF09\uFF0C\u800C\u901A\u9053\u53EF\u4EE5\u7528\u4E8E\u8BFB\uFF0C\u5199\u6216\u8005\u4E8C\u8005\u540C\u65F6\u8FDB\u884C\uFF0C\u6700\u5173\u952E\u662F\u53EF\u4EE5\u4E0E\u591A\u8DEF\u590D\u7528\u5668\uFF08Selector\uFF09\u7ED3\u5408\u8D77\u6765\uFF0C\u6709\u591A\u949F\u7684\u72B6\u6001\u4F4D\uFF0C\u65B9\u4FBF\u591A\u8DEF\u590D\u7528\u5668\u53BB\u8BC6\u522B\uFF0C\u4EE5\u6B64\u6267\u884C\u4E0D\u540C\u7684handler\u3002</p><h2 id="_3\u3001selector-\u591A\u8DEF\u590D\u7528\u5668" tabindex="-1"><a class="header-anchor" href="#_3\u3001selector-\u591A\u8DEF\u590D\u7528\u5668" aria-hidden="true">#</a> 3\u3001Selector-\u591A\u8DEF\u590D\u7528\u5668</h2><p>\u591A\u8DEF\u590D\u7528\u5668\uFF08seletor\uFF09\uFF0C\u4ED6\u662FNIO\u7F16\u7A0B\u7684\u57FA\u7840\uFF0C\u975E\u5E38\u91CD\u8981\uFF0C\u591A\u8DEF\u590D\u7528\u5668\u63D0\u4F9B\u9009\u62E9\u5DF2\u7ECF\u5C31\u7EEA\u7684\u4EFB\u52A1\u7684\u80FD\u529B\u3002</p><p>\u610F\u601D\u5C31\u662FSelector\u4F1A\u4E0D\u65AD\u5730\u8F6E\u8BE2\u6CE8\u518C\u5728\u5176\u4E0A\u7684\u901A\u9053\uFF08Channel\uFF09\uFF0C\u5982\u679C\u67D0\u4E2A\u901A\u9053\u53D1\u751F\u4E86\u8BFB\u5199\u64CD\u4F5C\uFF0C\u8FD9\u4E2A\u901A\u9053\u5C31\u5904\u4E8E\u5C31\u7EEA\u72B6\u6001\uFF0C\u4F1A\u88ABSelector\u8F6E\u8BE2\u51FA\u6765\uFF0C\u7136\u540E\u901A\u8FC7SelectionKey\u53EF\u4EE5\u53D6\u5F97\u5C31\u7EEA\u7684Channel\u96C6\u5408\uFF0C\u4ECE\u800C\u8FDB\u884C\u540E\u7EED\u7684IO\u64CD\u4F5C\u3002</p><p>\u603B\u7ED3\u8D77\u6765\uFF0CSelector\u7EBF\u7A0B\u5C31\u7C7B\u4F3C\u4E00\u4E2A\u7BA1\u7406\u8005\uFF08Master\uFF09,\u7BA1\u7406\u4E86\u6210\u5343\u4E0A\u4E07\u4E2A\u7BA1\u9053\uFF0C\u7136\u540E\u8F6E\u8BE2\u54EA\u4E2A\u7BA1\u9053\u7684\u6570\u636E\u5DF2\u7ECF\u51C6\u5907\u597D\uFF0C\u901A\u77E5CPU\u6267\u884CIO\u7684\u8BFB\u53D6\u6216\u5199\u5165\u64CD\u4F5C\u3002</p><p>Selector\u6A21\u5F0F\uFF1A\u5F53IO\u4E8B\u4EF6\u6CE8\u518C\u5230\u9009\u62E9\u5668\u4EE5\u540E\uFF0Cselector\u4F1A\u5206\u914D\u7ED9\u6BCF\u4E2A\u901A\u9053\u4E00\u4E2Akey\u503C\uFF0C\u76F8\u5F53\u4E8E\u6807\u7B7E\u3002selector\u9009\u62E9\u5668\u662F\u4EE5\u8F6E\u8BE2\u7684\u65B9\u5F0F\u8FDB\u884C\u67E5\u627E\u6CE8\u518C\u7684\u6240\u6709\u901A\u9053</p><p>\u5F53\u6211\u4EEC\u7684IO\u4E8B\u4EF6\uFF08\u901A\u9053\uFF09\u51C6\u5907\u5C31\u7EEA\u540E\uFF0Cselector\u5C31\u4F1A\u8BC6\u522B\uFF0C\u4F1A\u901A\u8FC7key\u503C\u6765\u627E\u5230\u76F8\u5E94\u7684\u7BA1\u9053\uFF0C\u8FDB\u884C\u76F8\u5173\u7684\u6570\u636E\u5904\u7406\u64CD\u4F5C\uFF08\u4ECE\u901A\u9053\u91CC\u8BFB\u6216\u5199\u6570\u636E\uFF0C\u5199\u5165\u6211\u4EEC\u7684\u6570\u636E\u7F13\u51B2\u533A\u4E2D\uFF09\u3002</p><p>\u4E00\u4E2A\u591A\u8DEF\u590D\u7528\u5668(Selector)\u53EF\u4EE5\u8D1F\u8D23\u6210\u5343\u4E0A\u4E07\u4E2AChannel\uFF0C\u6548\u7387\u6BD4\u8D77BIO\u5927\u5927\u7684\u63D0\u9AD8\u4E86\uFF0C\u7531\u4E8Ejdk\u4F7F\u7528\u4E86epoll\u4EE3\u66FF\u4F20\u7EDF\u7684select\u5B9E\u73B0\uFF0C\u6240\u4EE5\u6CA1\u6709\u6700\u5927\u8FDE\u63A5\u53E5\u67C41024/2048\u7684\u9650\u5236\uFF0C\u8FD9\u4E5F\u610F\u5473\u7740\u6211\u4EEC\u53EA\u8981\u4E00\u4E2A\u7EBF\u7A0B\u8D1F\u8D23selector\u7684\u8F6E\u8BE2,\u5C31\u53EF\u4EE5\u63A5\u5165\u6210\u5343\u4E0A\u4E07\u4E2A\u5BA2\u6237\u7AEF\uFF0C\u8FD9\u662FJDK\uFF0CNIO\u5E93\u7684\u5DE8\u5927\u8FDB\u6B65\u3002</p><p>\u4F46\u662FNIO\u4E5F\u6709\u7740\u81EA\u5DF1\u7684\u7F3A\u70B9\uFF0CNIO\u4F1A\u7B49\u6570\u636E\u51C6\u5907\u597D\u540E\uFF0C\u518D\u4EA4\u7531\u5E94\u7528\u8FDB\u884C\u5904\u7406\uFF0C\u6570\u636E\u7684\u8BFB\u53D6/\u5199\u5165\u8FC7\u7A0B\u4F9D\u7136\u5728\u5E94\u7528\u7EBF\u7A0B\u4E2D\u5B8C\u6210\uFF0C\u53EA\u662F\u5C06\u7B49\u5F85\u7684\u65F6\u95F4\u5265\u79BB\u5230\u5355\u72EC\u7684\u7EBF\u7A0B\u4E2D\u53BB\uFF0C\u8282\u7701\u4E86\u6570\u636E\u51C6\u5907\u65F6\u95F4\uFF0C\u56E0\u4E3A\u591A\u8DEF\u590D\u7528\u673A\u5236\uFF0Cchannel\u4F1A\u5F97\u5230\u590D\u7528\uFF0C\u5BF9\u4E8E\u90A3\u4E9B\u8BFB\u5199\u8FC7\u7A0B\u65F6\u95F4\u957F\u7684\uFF0CNIO\u5C31\u4E0D\u592A\u9002\u5408\u3002</p><p>\u4F46\u662F\uFF0C\u6211\u4EEC\u9700\u8981\u6CE8\u610F\uFF0C\u867D\u7136\u8BF4NIO\u662F\u975E\u963B\u585E\u7684\uFF0C\u4F46\u662F\uFF0Csellector\u4E2D\u7684sellector.select()\uFF0C\u662F\u963B\u585E\u7684\uFF0C\u6240\u4EE5\uFF0C\u4F60\u662F\u4E0D\u662F\u4F1A\u6709\u4EC0\u4E48\u6709\u8DA3\u7684\u60F3\u6CD5\u5462\uFF1F\u4F8B\u5982\uFF0C\u628Asellector\u8FD9\u4E2A\u7EBF\u7A0B\uFF0C\u4E5F\u662F\u7528\u7EBF\u7A0B\u6C60\u6765\u5206\u914D\u3002</p><p>\u597D\u7684\uFF0C\u522B\u60F3\u4E86\uFF0C\u5728\u60F3\u90A3\u5C31\u662FNetty\u4E86\u3002Netty\u7684\u5E95\u5C42\u5C31\u662FNIO\u3002</p><p>\u4E3A\u4E86\u89E3\u51B3\u4E0A\u8FF0\u7684\u95EE\u9898\uFF0C\u63A8\u51FA\u4E86 NIO \u7684\u6982\u5FF5\uFF0C\u4E5F\u5C31\u662F(Non-blocking I/O)\u3002\u5176\u4E2D\uFF0CSelector \u673A\u5236\u5C31\u662F NIO \u7684\u6838\u5FC3\u3002</p><p>\u5F53\u6BCF\u6B21\u5BA2\u6237\u7AEF\u8BF7\u6C42\u65F6\uFF0C\u4F1A\u521B\u5EFA\u4E00\u4E2A Socket Channel\uFF0C\u5E76\u5C06\u5176\u6CE8\u518C\u5230 Selector \u4E0A(\u591A\u8DEF\u590D\u7528\u5668)\u3002</p><p>\u7136\u540E\uFF0CSelector \u5173\u6CE8\u670D\u52A1\u7AEF IO \u8BFB\u5199\u4E8B\u4EF6\uFF0C\u6B64\u65F6\u5BA2\u6237\u7AEF\u5E76\u4E0D\u7528\u7B49\u5F85 IO \u4E8B\u4EF6\u5B8C\u6210\uFF0C\u53EF\u4EE5\u7EE7\u7EED\u505A\u63A5\u4E0B\u6765\u7684\u5DE5\u4F5C\u3002</p><p>\u4E00\u65E6\uFF0C\u670D\u52A1\u7AEF\u5B8C\u6210\u4E86 IO \u8BFB\u5199\u64CD\u4F5C\uFF0CSelector \u4F1A\u63A5\u5230\u901A\u77E5\uFF0C\u540C\u65F6\u544A\u8BC9\u5BA2\u6237\u7AEF IO \u64CD\u4F5C\u5DF2\u7ECF\u5B8C\u6210\u3002</p><p>\u63A5\u5230\u901A\u77E5\u7684\u5BA2\u6237\u7AEF\uFF0C\u5C31\u53EF\u4EE5\u901A\u8FC7 SocketChannel \u83B7\u53D6\u9700\u8981\u7684\u6570\u636E\u4E86\u3002</p><p>\u4E0A\u9762\u63CF\u8FF0\u7684\u8FC7\u7A0B\u6709\u70B9\u5F02\u6B65\u7684\u610F\u601D\uFF0C\u4E0D\u8FC7\uFF0CSelector \u5B9E\u73B0\u7684\u5E76\u4E0D\u662F\u771F\u6B63\u610F\u4E49\u4E0A\u7684\u5F02\u6B65\u64CD\u4F5C\u3002</p><p>\u56E0\u4E3A Selector \u9700\u8981\u901A\u8FC7\u7EBF\u7A0B\u963B\u585E\u7684\u65B9\u5F0F\u76D1\u542C IO \u4E8B\u4EF6\u53D8\u66F4\uFF0C\u53EA\u662F\u8FD9\u79CD\u65B9\u5F0F\u6CA1\u6709\u8BA9\u5BA2\u6237\u7AEF\u7B49\u5F85\uFF0C\u662F Selector \u5728\u7B49\u5F85 IO \u8FD4\u56DE\uFF0C\u5E76\u4E14\u901A\u77E5\u5BA2\u6237\u7AEF\u53BB\u83B7\u53D6\u6570\u636E\u3002\u771F\u6B63\u201C\u5F02\u6B65 IO\u201D(AIO)\u8FD9\u91CC\u4E0D\u5C55\u5F00\u4ECB\u7ECD\uFF0C\u6709\u5174\u8DA3\u53EF\u4EE5\u81EA\u884C\u67E5\u627E\u3002</p><p>\u8BF4\u597D\u4E86 NIO \u518D\u6765\u8C08\u8C08 Netty\uFF0CNetty \u4F5C\u4E3A NIO \u7684\u5B9E\u73B0\uFF0C\u5B83\u9002\u7528\u4E8E\u670D\u52A1\u5668/\u5BA2\u6237\u7AEF\u901A\u8BAF\u7684\u573A\u666F\uFF0C\u4EE5\u53CA\u9488\u5BF9\u4E8E TCP \u534F\u8BAE\u4E0B\u7684\u9AD8\u5E76\u53D1\u5E94\u7528\u3002</p><p>\u5BF9\u4E8E\u5F00\u53D1\u8005\u6765\u8BF4\uFF0C\u5B83\u5177\u6709\u4EE5\u4E0B\u7279\u70B9\uFF1A</p><p>\u5BF9 NIO \u8FDB\u884C\u5C01\u88C5\uFF0C\u5F00\u53D1\u8005\u4E0D\u9700\u8981\u5173\u6CE8 NIO \u7684\u5E95\u5C42\u539F\u7406\uFF0C\u53EA\u9700\u8981\u8C03\u7528 Netty \u7EC4\u4EF6\u5C31\u80FD\u591F\u5B8C\u6210\u5DE5\u4F5C\u3002</p><p>\u5BF9\u7F51\u7EDC\u8C03\u7528\u900F\u660E\uFF0C\u4ECE Socket \u5EFA\u7ACB TCP \u8FDE\u63A5\u5230\u7F51\u7EDC\u5F02\u5E38\u7684\u5904\u7406\u90FD\u505A\u4E86\u5305\u88C5\u3002</p><p>\u5BF9\u6570\u636E\u5904\u7406\u7075\u6D3B\uFF0C Netty \u652F\u6301\u591A\u79CD\u5E8F\u5217\u5316\u6846\u67B6\uFF0C\u901A\u8FC7\u201CChannelHandler\u201D\u673A\u5236\uFF0C\u53EF\u4EE5\u81EA\u5B9A\u4E49\u201C\u7F16/\u89E3\u7801\u5668\u201D\u3002</p><p>\u5BF9\u6027\u80FD\u8C03\u4F18\u53CB\u597D\uFF0CNetty \u63D0\u4F9B\u4E86\u7EBF\u7A0B\u6C60\u6A21\u5F0F\u4EE5\u53CA Buffer \u7684\u91CD\u7528\u673A\u5236(\u5BF9\u8C61\u6C60\u5316)\uFF0C\u4E0D\u9700\u8981\u6784\u5EFA\u590D\u6742\u7684\u591A\u7EBF\u7A0B\u6A21\u578B\u548C\u64CD\u4F5C\u961F\u5217\u3002</p><h2 id="aio" tabindex="-1"><a class="header-anchor" href="#aio" aria-hidden="true">#</a> AIO</h2><p>AIO\u7F16\u7A0B\uFF0C\u5728NIO\u57FA\u7840\u4E4B\u4E0A\u5F15\u5165\u4E86\u5F02\u6B65\u901A\u9053\u7684\u6982\u5FF5\u3002\u5E76\u63D0\u4F9B\u5F02\u6B65\u6587\u4EF6\u548C\u5F02\u6B65\u5957\u63A5\u5B57\u901A\u9053\u7684\u5B9E\u73B0\uFF0C\u4ECE\u800C\u5728\u771F\u6B63\u610F\u4E49\u4E0A\u5B9E\u73B0\u4E86\u5F02\u6B65\u975E\u963B\u585E\uFF0C\u4E4B\u524D\u6211\u4EEC\u5B66\u8FC7\u7684NIO\u53EA\u662F\u975E\u963B\u585E\u800C\u975E\u5F02\u6B65\u3002\u800CAIO\u5B83\u4E0D\u9700\u8981\u901A\u8FC7\u591A\u8DEF\u590D\u7528\u5668\u5BF9\u6CE8\u518C\u7684\u901A\u9053\u8FDB\u884C\u8F6E\u8BE2\u64CD\u4F5C\u3002\u4E5F\u53EF\u4EE5\u79F0\u4E3ANIO2.0\uFF0C\u8FD9\u8FD9\u79CD\u6A21\u5F0F\u624D\u662F\u771F\u6B63\u7684\u5C5E\u4E8E\u5F02\u6B65\u975E\u963B\u585E\u7684\u6A21\u578B\u3002</p><p>\u81F3\u4E8E\u4E0A\u9762\u8BF4\u7684AIO\u4E0D\u9700\u8981\u901A\u8FC7\u591A\u8DEF\u590D\u7528\u5668\u5BF9\u6CE8\u518C\u7684\u901A\u9053\u8FDB\u884C\u8F6E\u8BE2\u64CD\u4F5C\u5373\u53EF\u5B9E\u73B0\u5F02\u6B65\u8BFB\u5199\u3002\u4EC0\u4E48\u610F\u601D\u5462\uFF1F</p><h2 id="\u4E09\u8005\u533A\u522B" tabindex="-1"><a class="header-anchor" href="#\u4E09\u8005\u533A\u522B" aria-hidden="true">#</a> \u4E09\u8005\u533A\u522B</h2><p>BIO\uFF1ABIO\u65B9\u5F0F\u9002\u7528\u4E8E</p>',42);function p(n,o){return t}var l=r(a,[["render",p],["__file","nio.html.vue"]]);export{l as default};
